import PropTypes from "prop-types";

import "./GoalDisplay.scss";

export const GoalDisplay = ({ isCardio, goal }) => {
  return (
    <div className="GoalContainer d-flex flex-column">
      <h3 className="text-start">Goal:</h3>
      {isCardio ? (
        <div>{goal.duration}</div>
      ) : (
        <div className="d-flex flex-row">
          <div className="col-3">{goal.sets}</div>
          <div className="col-3">{`${goal.min_reps}-${goal.max_reps}`}</div>
          <div className="col-3">{goal.weight} lbs</div>
        </div>
      )}
    </div>
  );
};

GoalDisplay.propTypes = {
  isCardio: PropTypes.bool,
  goal: PropTypes.object,
};
